import{_ as e,c as t,o as a,a as o}from"./app.b9792699.js";const u=JSON.parse('{"title":"\uC624\uB298\uC758 \uAE30\uB85D","description":"","frontmatter":{"title":"\uC624\uB298\uC758 \uAE30\uB85D","createBy":"2022-09-27T00:00:00.000Z"},"headers":[],"relativePath":"TIL/202209/20220927.md"}'),r={name:"TIL/202209/20220927.md"},l=o('<br><h2 style="font-size:26px;color:black;">\uC624\uB298\uC758 \uC774\uC57C\uAE30\u{1F9E7}</h2><hr><p>\uC624\uB298\uC740 \uD68C\uC0AC\uC5D0\uC11C \uC138\uBBF8\uB098 \uBC1C\uD45C\uAC00 \uC788\uB294 \uB0A0\uC774\uB2E4. \uC810\uC2EC \uBA39\uACE0 \uC788\uB294 \uBC1C\uD45C\uB77C \uC624\uC804\uC5D0\uB294 \uBC1C\uD45C\uC5D0 \uB300\uD55C \uC9C8\uBB38\uC5D0 \uB300\uD574 \uB300\uBE44\uD560 \uC218 \uC788\uB3C4\uB85D \uAE30\uCD08 \uAC1C\uB150\uC5D0 \uB300\uD574 \uCCA0\uC800\uD788 \uACF5\uBD80\uD558\uC600\uB2E4. \uBC1C\uD45C\uC2DC\uAC04\uC774 \uB2E4\uAC00\uC624\uACE0.... \uBC1C\uD45C\uB294 \uC5B8\uC81C\uB098 \uD574\uB3C4 \uC5B4\uB824\uC6B4\uAC70 \uAC19\uB2E4. \uC5B4\uC81C \uAE09\uD558\uAC8C \uB9CC\uB4E0 \uD53C\uD53C\uD2F0 \uB355\uBD84\uC5D0 \uAD49\uC7A5\uD788 \uD53C\uD53C\uD2F0\uAC00 \uB354\uB7EC\uC6CC \uBCF4\uC600\uC9C0\uB9CC. \uADF8\uB798\uB3C4 1\uC2DC\uAC04,,\uC815\uB3C4 \uBC1C\uD45C\uC640 \uC9C8\uC758 \uC751\uB2F5\uC744 \uB9C8\uCE58\uACE0 \uACFC\uC7A5\uB2D8\uAED8\uC11C \uC218\uACE0 \uD588\uB2E4\uACE0 \uC5B4\uB824\uC6E0\uB358\uAC74\uB370 \uC798 \uD588\uB2E4\uACE0. \uB9D0\uC500\uD558\uC154\uC11C \uC548\uB3C4\uD558\uC600\uB2E4. \uD558\uC9C0\uB9CC \uADF8\uAC78\uB85C \uC548\uB3C4\uD574\uC120 \uC548\uB41C\uB2E4.. \uB098\uB294 \uADF8 \uC5B4\uB824\uC6E0\uB358 \uAC74\uB370 \uB77C\uB294 \uB9D0\uC744 \uB4E3\uACE0 \uC2F6\uC9C0 \uC54A\uC558\uB2E4. \uC5B4\uB824\uC6E0\uB358\uAC70 \uB9DE\uB0D0 \uB77C\uB294 \uB9D0\uC744 \uB4E3\uACE0 \uC2F6\uC5C8\uB2E4. \u315C\u315C \uB354 \uC5F4\uC2EC\uD788 \uD574\uC57C\uACA0\uB2E4\uACE0 \uC0DD\uAC01\uD588\uB2E4. \uBC1C\uD45C\uB97C \uB9C8\uCE58\uACE0 \uD300\uC7A5\uB2D8\uAED8\uC11C \uD68C\uC758\uC2E4\uB85C \uD638\uCD9C\uD558\uC154\uC11C \uAC14\uB2E4. \uD300\uC7A5\uB2D8\uC774\uB791\uC740 \uC774\uC81C\uBD80\uD130 \uC5B4\uB5A4 \uC5C5\uBB34\uB97C \uB9E1\uC744\uC9C0 \uC5B4\uB5A4 \uBD84\uC57C\uB85C \uC77C\uC744 \uD560\uAC83\uC778\uC9C0\uC5D0 \uB300\uD574 \uD68C\uC758\uD558\uC600\uB2E4. \uCC98\uC74C\uC5D4 \uC5B4\uB5A4\uAC70 \uD558\uACE0 \uC2F6\uB0D0\uACE0 \uBB3C\uC5B4\uBCF4\uC168\uC9C0\uB9CC. \uCD5C\uC885 \uACB0\uACFC\uB294 \uBB50\uB4E0 \uB2E4\u314F \uD574\uC57C\uD558\uB294 \uAC83\uC774\uB2E4\uB77C\uACE0 \uC54C\uC544\uB4E4\uC5C8\uB2E4 \u314E \uB098\uB3C4 \uD55C\uAC00\uC9C0\uB9CC \uD558\uAE30 \uBCF4\uB2E8 \uACBD\uD5D8 \uC313\uC73C\uBA74\uC11C \uB450\uB8E8\uB450\uB8E8 \uD558\uACE0 \uC2F6\uC5C8\uAE30\uC5D0 \uBD88\uB9CC \uBD88\uD3C9\uC5C6\uC774 \uC88B\uB2E4\uACE0 \uC5F4\uC2EC\uD788 \uD558\uACA0\uB2E4\uACE0 \uB300\uB2F5\uD588\uB2E4. 11\uC6D4 \uB2EC\uBD80\uD130 \uACFC\uC81C\uB098 \uC5C5\uBB34\uD560\uAC70\uB77C\uB294\uB370 \uADF8 \uC804\uAE4C\uC9C0 \uC5F4\uC2EC\uD788 \uC900\uBE44\uD574 \uB194\uC57C \uD560\uAC70 \uAC19\uB2E4. \uC624\uB298 \uC870\uAE08 \uBD80\uC871\uD55C\uAC8C \uC788\uC5B4\uC11C \uC9D1\uC5D0\uC11C \uB2E4\uC2DC \uBC1C\uD45C\uB97C \uD55C\uB2E4\uB294 \uC0DD\uAC01\uC73C\uB85C PPT\uB97C \uC81C\uC791\uD558\uC5EC \uC601\uC0C1\uC744 \uCC0D\uC5B4\uC11C \uBC1C\uD45C\uB97C \uD574\uBD10\uC57C \uD560\uAC70 \uAC19\uB2E4.</p><h4 id="" tabindex="-1"><a class="header-anchor" href="#" aria-hidden="true">#</a></h4><h2 style="font-size:26px;color:black;">\uC624\uB298 \uACF5\uBD80\uD55C \uB0B4\uC6A9 \u{1F4CB}</h2><hr><ul><li>\uC138\uBBF8\uB098 \uBC1C\uD45C</li></ul><h2 style="font-size:26px;color:black;">\uC5B4\uB824\uC6E0\uB358 \uB0B4\uC6A9 \u{1F922}</h2><hr><h2 style="font-size:26px;color:black;">\uAD81\uAE08\uD55C \uB0B4\uC6A9 / \uBD80\uC871\uD55C \uB0B4\uC6A9 \u{1F9D0}</h2><hr><ul><li>\uBC1C\uD45C \uC798 \uD558\uB294 \uBC29\uBC95\uC744 \uC775\uD788\uACE0, \uD63C\uC790\uC11C \uBC1C\uD45C\uD558\uB294 \uB2A5\uB825\uC744 \uD0A4\uC6CC\uC57C \uD560\uAC70 \uAC19\uB2E4.</li><li>\uB9CE\uC774 \uACF5\uBD80 \uD588\uB358 \uB0B4\uC6A9 \uC774\uC600\uC9C0\uB9CC.. \uB300\uB2F5\uC744 \uD655\uC2E4\uD558\uAC8C \uD558\uC9C0 \uBABB\uD55C \uBD80\uBD84\uC774 \uD6C4\uD68C\uAC00 \uB41C\uB2E4.</li></ul>',13),s=[l];function c(_,i,n,h,d,p){return a(),t("div",null,s)}const T=e(r,[["render",c]]);export{u as __pageData,T as default};
